  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of digital water-table
  contours for the Mojave River and the Morongo Ground-Water Basins. The U.S. Geological
  Survey constructed a water-table map of the Mojave River and the Morongo Ground-Water
  Basins for ground-water levels measured during the spring of 1998. Water-level data
  were collected from 418 wells to construct the contours. The water-table contours
  were digitized from the paper map which was published at a scale of 1:175,512. The
  contour interval rangs from 3,400 to 1,500 feet above sea level.\",\n\t\"owner_org\":
